async function initializeDatabase() {
    try {
        const count = await Video.countDocuments();
        if (count === 0) {
            await Video.insertMany(initialVideos);
            console.log("Initial videos inserted.");
        } else {
            console.log("Videos already initialized.");
        }

        const userCount = await User.countDocuments();
        if (userCount === 0) {
            for (const userData of initialUsers) {
                await UserService.createUser(userData); // Use the createUser function from the user service
            }
            console.log("Initial users inserted.");
        } else {
            console.log("Users already initialized.");
        }

    } catch (err) {
        console.error("Error initializing database:", err);
    }
}

module.exports = initializeDatabase